import React from "react";
import Navbar from "./components/Navbar";
import { BrowserRouter, Route } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
        <Route path="/" element={<div>Metti il tuo component qui</div>} />
    </BrowserRouter>
  );
}

export default App;
